import React from "react";
import { Row, Col } from "reactstrap";
import SubHeader from "../../component/sub-header";
import PaginationRemote from '../../component/PaginationRemote'
import { formatRupiah } from '../../utilities/helpers';
import moment from "moment";

export default class Order extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      params: {
        q: '',
        page: 1,
        limit: 20,
        sizePerPage: 20,
        totalSize: 200,
        start_date: '',
        end_date: '',
        customer_id: '',
        status: ''
      }
    }
  }

  render() {
    return (
      <div className="section-search">
        <Row className="search-flight-heading bot">Data Order</Row>
        <Row className="step-form-table">
          <div style={{ width: "100%" }}>
            <SubHeader title={"List Data Order"} />
            <div className="form-search" >
              {/* <PaginationRemote /> */}
            </div>
          </div>
        </Row>
      </div>
    )
  }
}
